コスパよし味美！
だけど常連客とマスターの会話が長いと注文しにくいと感じるかも。カウンターの座る位置を考えればよかったぁとあとに感じました。常連客の間に座ってしまったような感じになり、なんとなくいたたまれない感じに、まぁ私が最初に来たときにどこに座れば良いか聞けば良かったのですが(^-^;
店員さんもマスターの人柄はとってもいいのでまた伺いたいですね

初めて🔰来店。lunchを注文。ﾐﾆ丼付きの盛り方が少しだけ雑。写メを撮るために具を程よく広げました。ほとんど白ごはん🍚でした。搾菜だけで食べなさい！と言うばかりでしょうか？野菜たっぷりたん麺は、お美味しいかったです。藤が丘店は、良く利用していました。日曜日前評判で決めたﾒﾆｭｰを頂いた。黒酢の酢豚ｾｯﾄ(soup、ザーサイ、ﾐﾆsalad)お美味しいかった☺️令和4.1.5lunch
令和4.1.8五目あんかけ焼きそばset(やわらか
)混んできたからなのか、全然熱くない。ぬるぬるのぬるま湯って感じ。寒い日なので、フーッふうして食べたかった。お正月に来た時のほうが美味しいかった。4.2.25油淋鶏lunch鶏とカシューナッツ炒めを頂きました。残念ですがｶｼﾕｰﾅｯﾂは、写真に写っている3粒？4粒？だけでした。中には入っていませんでした。もう少し食べたかったです。7月に入って久しぶりの来店。蒸し暑い日。ﾗﾝﾁよりも酢豚setを選びました。
